import React, { useState } from 'react';
import FileUpload from './components/FileUpload';
import PayloadGenerator from './components/PayloadGenerator';
import Results from './components/Results';

function App() {
  const [currentStep, setCurrentStep] = useState('upload');
  const [fileInfo, setFileInfo] = useState(null);
  const [payloads, setPayloads] = useState([]);
  const [results, setResults] = useState(null);
  const [error, setError] = useState('');

  const handleFileUploaded = (info) => {
    setFileInfo(info);
    setCurrentStep('generate');
    setError('');
  };

  const handlePayloadsGenerated = (generatedPayloads) => {
    setPayloads(generatedPayloads);
    setCurrentStep('results');
  };

  const handleError = (errorMessage) => {
    setError(errorMessage);
  };

  const resetApp = () => {
    setCurrentStep('upload');
    setFileInfo(null);
    setPayloads([]);
    setResults(null);
    setError('');
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 via-blue-900 to-purple-900">
      <div className="container mx-auto px-4 py-8">
        {/* Header */}
        <div className="text-center mb-8">
          <h1 className="text-4xl font-bold text-white mb-4">
            XXE XLSX Injection Tool
          </h1>
          <p className="text-gray-300 text-lg">
            Security testing tool for XML External Entity vulnerabilities
          </p>

          {/* Security Warning */}
          <div className="mt-6 bg-red-900/50 border border-red-500 rounded-lg p-4 max-w-2xl mx-auto">
            <div className="flex items-center">
              <svg className="w-6 h-6 text-red-400 mr-3" fill="currentColor" viewBox="0 0 20 20">
                <path fillRule="evenodd" d="M8.257 3.099c.765-1.36 2.722-1.36 3.486 0l5.58 9.92c.75 1.334-.213 2.98-1.742 2.98H4.42c-1.53 0-2.493-1.646-1.743-2.98l5.58-9.92zM11 13a1 1 0 11-2 0 1 1 0 012 0zm-1-8a1 1 0 00-1 1v3a1 1 0 002 0V6a1 1 0 00-1-1z" clipRule="evenodd" />
              </svg>
              <div>
                <h3 className="text-red-400 font-semibold">FOR AUTHORIZED TESTING ONLY</h3>
                <p className="text-red-300 text-sm">Use only on systems you own or have explicit permission to test</p>
              </div>
            </div>
          </div>
        </div>

        {/* Progress Steps */}
        <div className="flex justify-center mb-8">
          <div className="flex items-center space-x-4">
            <div className={`flex items-center ${currentStep === 'upload' ? 'text-blue-400' : currentStep === 'generate' || currentStep === 'results' ? 'text-green-400' : 'text-gray-500'}`}>
              <div className={`w-8 h-8 rounded-full flex items-center justify-center ${currentStep === 'upload' ? 'bg-blue-500' : currentStep === 'generate' || currentStep === 'results' ? 'bg-green-500' : 'bg-gray-600'}`}>
                1
              </div>
              <span className="ml-2 font-medium">Upload File</span>
            </div>

            <div className="w-8 h-0.5 bg-gray-600"></div>

            <div className={`flex items-center ${currentStep === 'generate' ? 'text-blue-400' : currentStep === 'results' ? 'text-green-400' : 'text-gray-500'}`}>
              <div className={`w-8 h-8 rounded-full flex items-center justify-center ${currentStep === 'generate' ? 'bg-blue-500' : currentStep === 'results' ? 'bg-green-500' : 'bg-gray-600'}`}>
                2
              </div>
              <span className="ml-2 font-medium">Generate Payloads</span>
            </div>

            <div className="w-8 h-0.5 bg-gray-600"></div>

            <div className={`flex items-center ${currentStep === 'results' ? 'text-blue-400' : 'text-gray-500'}`}>
              <div className={`w-8 h-8 rounded-full flex items-center justify-center ${currentStep === 'results' ? 'bg-blue-500' : 'bg-gray-600'}`}>
                3
              </div>
              <span className="ml-2 font-medium">Results</span>
            </div>
          </div>
        </div>

        {/* Error Display */}
        {error && (
          <div className="max-w-2xl mx-auto mb-6 bg-red-900/50 border border-red-500 rounded-lg p-4">
            <div className="flex items-center">
              <svg className="w-5 h-5 text-red-400 mr-2" fill="currentColor" viewBox="0 0 20 20">
                <path fillRule="evenodd" d="M10 18a8 8 0 100-16 8 8 0 000 16zM8.707 7.293a1 1 0 00-1.414 1.414L8.586 10l-1.293 1.293a1 1 0 101.414 1.414L10 11.414l1.293 1.293a1 1 0 001.414-1.414L11.414 10l1.293-1.293a1 1 0 00-1.414-1.414L10 8.586 8.707 7.293z" clipRule="evenodd" />
              </svg>
              <span className="text-red-300">{error}</span>
            </div>
          </div>
        )}

        {/* Main Content */}
        <div className="max-w-4xl mx-auto">
          {currentStep === 'upload' && (
            <FileUpload 
              onFileUploaded={handleFileUploaded}
              onError={handleError}
            />
          )}

          {currentStep === 'generate' && (
            <PayloadGenerator
              fileInfo={fileInfo}
              onPayloadsGenerated={handlePayloadsGenerated}
              onError={handleError}
              onBack={() => setCurrentStep('upload')}
            />
          )}

          {currentStep === 'results' && (
            <Results
              payloads={payloads}
              fileInfo={fileInfo}
              onBack={() => setCurrentStep('generate')}
              onReset={resetApp}
            />
          )}
        </div>
      </div>
    </div>
  );
}

export default App;
